Here is the step by step guide to create a full stack web application using React, Node.js, Express.js and MongoDB.

**Step 1: Set up the project structure**

Create a new folder for your project and navigate into it.

```
mkdir fullstack-app
cd fullstack-app
```

**Step 2: Set up the backend (Node.js & Express.js)**

Initialize a new Node.js project and install the required dependencies.

```
npm init -y
npm install express mongoose cors dotenv
```

Create a `.env` file to store your environment variables like database connection string.

```
MONGODB_URI=mongodb+srv://<username>:<password>@cluster.mongodb.net/test?retryWrites=true&w=majority
PORT=5000
```

Create an `index.js` file that will be the entry point of your server.

```javascript
const express = require('express');
const mongoose = require('mongoose');
const cors = require('cors');
const dotenv = require('dotenv');

dotenv.config();

const app = express();
app.use(cors());
app.use(express.json());

// Connect to MongoDB
mongoose.connect(process.env.MONGODB_URI, {
  useNewUrlParser: true,
  useUnifiedTopology: true,
});

const db = mongoose.connection;
db.on('error', console.error.bind(console, 'connection error:'));
db.once('open', () => {
  console.log('Connected to MongoDB');
});

// Define a Mongoose schema and model for dummy data
const dummySchema = new mongoose.Schema({
  name: String,
  description: String,
});

const Dummy = mongoose.model('Dummy', dummySchema);

// API route to create dummy data
app.post('/api/dummy', async (req, res) => {
  const dummy = new Dummy(req.body);
  try {
    await dummy.save();
    res.status(201).send(dummy);
  } catch (error) {
    res.status(400).send(error);
  }
});

// API route to get all dummy data
app.get('/api/dummy', async (req, res) => {
  try {
    const dummies = await Dummy.find();
    res.send(dummies);
  } catch (error) {
    res.status(500).send(error);
  }
});

// Start the server
const port = process.env.PORT || 5000;
app.listen(port, () => console.log(`Server running on port ${port}`));
```

